window.bookSummaryJSON = "<p>When her most closely guarded secrets are laid bare, how will Kira survive the inevitable fall out - and will anybody be standing beside her in the end?</p> <p>Traveling to the planet of Jettie in the hopes of finding safe harbor for her niece, Kira arrives only to find their destination host to the quorum - a series of dangerous contests that hold the power to decide the fate of empires.</p> <p>With little choice but to participate, it doesn't take long for Kira to find herself knee deep in enemies. Surrounded on all sides, Kira will have to face her worst fear: trusting others with the truth.</p> <p>Because it's becoming clear the tsavitee are no longer content to exist in the shadows. War is coming - and everything Kira thought she once knew is about to change.</p>"; 
